import React from 'react';



const Home = () => {
return(
   <>


   <h1 className = "title" ><span>About Me</span></h1>


   <h2 className = "projname">Software Engineer</h2>

   <p className = "hired">I am a driven team player who uses my technical and analytical skills to help the company accomplish its goals. I am always looking to gain more knowledge and update my skills. I enjoy using my creativity to find new ways to solve problems. </p>



   </>
)
}





export default Home;
